/* Solución con ficheiro mp3 */
function musica(ficheiro) {
	audio.innerHTML = '<audio autoplay><source src="' + './sons/' + ficheiro + '.mp3' + '"></audio>';
}

function controlarChoqueBarra() {
	// Controlamos que estea á altura da barra e que choque con ela
	if (ordenada >= barra.offsetTop - barra.height && abscisa >= barra.offsetLeft && abscisa <= barra.offsetLeft + barra.width) {
		musica('pitido');	// emitir un pitido cando golpeamos a bóla
		sentido_Y = !sentido_Y;
		if (abscisa < barra.offsetLeft + 0.25 * barra.width || abscisa > barra.offsetLeft + 0.75 * barra.width) {
			sentido_X = !sentido_X;
		} else {
			variacion_X = (abscisa - barra.offsetLeft) / barra.width		// cambiamos o ángulo e a velocidade da bóla
			variacion_Y = (abscisa - barra.offsetLeft) * (Math.random() * 5 + 2) / barra.width	// cambiamos o ángulo e a velocidade da bóla
		}
		ordenada = barra.offsetTop - barra.height;
	}
}
